import React, { Component } from 'react';
import classes from './EmployeeControls.module.css';
import Button from '../../UI/Button/Button';

class EmployeeControls extends Component {
    render () {
        return (
            <div className={classes.EmployeeControls}>
                <Button btnType='ButtonBlue' clicked={this.props.newEmployee}>Add</Button>
            </div>
        )
    }
}

export default EmployeeControls;
